import React,{Component} from 'react';
import './ExtraContent.css'
export default class ExtraContent extends Component{
    render(){
        return(
            <div className="extraContent">
                <h3>Extra Content</h3>
                
                <p>Üç Yüzük göğün altında yaşayan Elf krallarına, Yedisi taştan saraylarındaki Cüce hükümdarlara, 
                    Dokuzu ölümlü insanlara, ölecekler ne yazık; Bir Yüzük gölgeler içindeki Mordor Diyarı'nda, 
                    Kara tahtında oturan Karanlıklar Efendisi'ne. Hepsine hükmedecek bir yüzük,Hepsini o bulacak, 
                    Hepsini bir araya getirip,karanlıkta birbirine bağlayacak Gölgeler içindeki Mordor Diyarı'nda.</p>
            </div>
        )
    }
}
